CREATE FUNCTION public.eli_inventario() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
IF EXISTS (SELECT * FROM erp_i_movpt_total WHERE pro_id=OLD.pro_id AND cod_punto_emision=OLD.bod_id AND pro_tbl=OLD.mov_tabla) THEN

IF (SELECT trs_operacion FROM  erp_transacciones WHERE trs_id=OLD.trs_id)=0 THEN
UPDATE erp_i_movpt_total 
SET mvt_cant=(mvt_cant-OLD.mov_cantidad),mvt_costo = (mvt_costo - OLD.mov_val_tot)
WHERE pro_id=OLD.pro_id 
AND cod_punto_emision=OLD.bod_id AND pro_tbl=OLD.mov_tabla;

ELSE
UPDATE erp_i_movpt_total 
SET mvt_cant=(mvt_cant+OLD.mov_cantidad),mvt_costo = (mvt_costo + OLD.mov_val_tot) 
WHERE pro_id=OLD.pro_id 
AND cod_punto_emision=OLD.bod_id AND pro_tbl=OLD.mov_tabla;

END IF;

END IF;
RETURN NULL;
END;
$$;


