--
-- TOC entry 355 (class 1259 OID 165735)
-- Name: generar_rol; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.generar_rol AS
 SELECT crosstab.prod,
    crosstab.loc1,
    crosstab.loc2,
    crosstab.loc3,
    crosstab.loc4,
    crosstab.loc5,
    crosstab.loc6,
    crosstab.loc7,
    crosstab.loc8,
    crosstab.loc9,
    crosstab.loc10,
    crosstab.loc11,
    crosstab.loc12,
    crosstab.loc13,
    crosstab.loc14
   FROM public.crosstab('select 
emp.emp_id || ''&'' || emp.emp_apellido_paterno || ''&'' || emp.emp_apellido_materno || ''&'' || emp.emp_nombres || ''&'' || nom.nom_forma_pago || ''&'' || nom.nom_periodo || ''&'' || nom.nom_fp_desde || ''&'' || nom.nom_fp_hasta || ''&'' || nom.nom_sueldo_base || ''&'' || nom.nom_dias_trabajados || ''&'' || nom.nom_id || ''&'' || nom.nom_anio as empleado, 
ROW_NUMBER() OVER(PARTITION BY nom.nom_id ORDER BY det.dnm_rubro ASC) AS nrubros,
det.dnm_valor
from par_empleados emp
LEFT join erp_nomina nom on (nom.nom_empleado=emp.emp_id)
join erp_det_nomina det on (det.nom_id=nom.nom_id)

'::text, 'select l from generate_series(1,14) l'::text) crosstab(prod text, loc1 text, loc2 text, loc3 text, loc4 text, loc5 text, loc6 text, loc7 text, loc8 text, loc9 text, loc10 text, loc11 text, loc12 text, loc13 text, loc14 text);


ALTER TABLE public.generar_rol OWNER TO postgres;

