CREATE VIEW public.pagos AS
 SELECT f.cli_id,
    f.fac_total_valor,
    p.pag_fecha_v,
    p.pag_cant,
    ( SELECT sum(c.cta_monto) AS sum
           FROM public.erp_ctasxcobrar c
          WHERE (((c.pag_id = p.pag_id) AND ((c.cta_forma_pago)::text <> 'NOTA DE DEBITO'::text)) AND (c.cta_estado = 0))) AS credito,
    ( SELECT sum(c.cta_monto) AS sum
           FROM public.erp_ctasxcobrar c
          WHERE (((c.pag_id = p.pag_id) AND ((c.cta_forma_pago)::text = 'NOTA DE DEBITO'::text)) AND (c.cta_estado = 0))) AS debito,
    f.fac_fecha_emision,
    f.fac_numero,
    f.fac_id,
    p.pag_id
   FROM public.erp_pagos_factura p,
    public.erp_factura f
  WHERE ((f.fac_id = p.com_id) AND (p.pag_estado = 0));


ALTER TABLE public.pagos OWNER TO postgres;

