CREATE VIEW public.pagos_documentos AS
 SELECT f.cli_id,
    f.reg_total,
    p.pag_fecha_v,
    p.pag_valor AS pag_cant,
    ( SELECT sum(c.ctp_monto) AS sum
           FROM public.erp_ctasxpagar c
          WHERE (((c.pag_id = p.pag_id) AND ((c.ctp_forma_pago)::text <> 'NOTA DE DEBITO'::text)) AND (c.ctp_estado = 0))) AS credito,
    ( SELECT sum(c.ctp_monto) AS sum
           FROM public.erp_ctasxpagar c
          WHERE (((c.pag_id = p.pag_id) AND ((c.ctp_forma_pago)::text = 'NOTA DE DEBITO'::text)) AND (c.ctp_estado = 0))) AS debito,
    f.reg_femision,
    f.reg_num_documento,
    f.reg_id,
    p.pag_id
   FROM public.erp_pagos_documentos p,
    public.erp_reg_documentos f
  WHERE ((f.reg_id = p.reg_id) AND (f.reg_estado = 1));


ALTER TABLE public.pagos_documentos OWNER TO postgres;

--
-- TOC entry 478 (class 1259 OID 314291)
-- Name: pagosxfactura; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.pagosxfactura AS
 SELECT f.cli_id,
    f.fac_total_valor,
    ( SELECT p.pag_fecha_v
           FROM public.erp_pagos_factura p
          WHERE (p.com_id = f.fac_id)
          ORDER BY p.pag_fecha_v DESC
         LIMIT 1) AS pag_fecha_v,
    ( SELECT sum(c.cta_monto) AS sum
           FROM public.erp_ctasxcobrar c
          WHERE ((c.com_id = f.fac_id) AND (c.cta_estado = 1))) AS pago,
    (f.fac_total_valor - ( SELECT sum(c.cta_monto) AS sum
           FROM public.erp_ctasxcobrar c
          WHERE ((c.com_id = f.fac_id) AND (c.cta_estado = 1)))) AS saldo,
    f.fac_fecha_emision,
    f.fac_numero,
    f.fac_id
   FROM public.erp_factura f
  WHERE ((f.fac_estado = 4) OR (f.fac_estado = 6));


ALTER TABLE public.pagosxfactura OWNER TO postgres;

