-- TOC entry 450 (class 1259 OID 165983)
-- Name: preciovp; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.preciovp AS
 SELECT d.pro_id,
    p.ids,
    p.mp_c,
    p.mp_d,
    p.mp_p,
    (sum(d.dfc_precio_unit) / (count(*))::numeric) AS v_unit,
    (sum(d.dfc_val_descuento) / (count(*))::numeric) AS descuento
   FROM public.erp_det_factura d,
    public.erp_mp p
  WHERE (d.pro_id = p.id)
  GROUP BY d.pro_id, p.mp_c, p.mp_d, p.ids, p.mp_p
  ORDER BY p.mp_c;


ALTER TABLE public.preciovp OWNER TO postgres;

