--
-- TOC entry 452 (class 1259 OID 165989)
-- Name: ventas_netas2; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.ventas_netas2 AS
 SELECT crosstab.fecha,
    crosstab.loc1,
    crosstab.loc2,
    crosstab.loc3,
    crosstab.loc4,
    crosstab.loc5,
    crosstab.loc6,
    crosstab.loc7,
    crosstab.loc8,
    crosstab.loc9,
    crosstab.loc10,
    crosstab.loc11,
    crosstab.loc12,
    crosstab.loc13,
    crosstab.loc14
   FROM public.crosstab('select 
com.fac_fecha_emision || ''&'' || ''0'' as fecha,
com.emi_id,
''''||coalesce(sum(com.fac_total_valor),0) as total
from erp_factura com
where fac_estado_aut<>''ANULADO'' or fac_estado_aut is null
group by 
com.fac_fecha_emision,
com.emi_id
union
select 
n.ncr_fecha_emision || ''&'' ||''1'' as fecha,
n.emi_id,
''-''||coalesce(sum(n.nrc_total_valor),0) as total
from erp_nota_credito n where n.ncr_estado_aut <>''ANULADO'' or n.ncr_estado_aut is null
group by 
n.ncr_fecha_emision,
n.emi_id

order by 1,2
'::text, 'select l from generate_series(1,14) l'::text) crosstab(fecha text, loc1 text, loc2 text, loc3 text, loc4 text, loc5 text, loc6 text, loc7 text, loc8 text, loc9 text, loc10 text, loc11 text, loc12 text, loc13 text, loc14 text);


ALTER TABLE public.ventas_netas2 OWNER TO postgres;

--
-- TOC entry 453 (class 1259 OID 165993)
-- Name: ventas_por_producto; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.ventas_por_producto AS
 SELECT crosstab.prod,
    crosstab.loc1,
    crosstab.loc2,
    crosstab.loc3,
    crosstab.loc4,
    crosstab.loc5,
    crosstab.loc6,
    crosstab.loc7,
    crosstab.loc8,
    crosstab.loc9,
    crosstab.loc10,
    crosstab.loc11,
    crosstab.loc12,
    crosstab.loc13,
    crosstab.loc14
   FROM public.crosstab('select 
pro.id|| ''&'' ||pro.mp_c || ''&'' || pro.mp_d|| ''&'' || com.fac_fecha_emision || ''&'' || pro.ids as producto,
com.emi_id,
coalesce(sum(det.dfc_cantidad),0) || ''&'' || coalesce(sum(det.dfc_precio_total),0) as sumas
from erp_factura com,
erp_det_factura det,
erp_mp pro
where det.fac_id=com.fac_id
and det.pro_id=pro.id
and (com.fac_estado_aut<>''ANULADO'' OR com.fac_estado_aut is null) 
group by
pro.id, 
pro.mp_c,
pro.mp_d,
com.fac_fecha_emision,
com.emi_id,
pro.ids
order by 1,2
'::text, 'select l from generate_series(1,14) l'::text) crosstab(prod text, loc1 text, loc2 text, loc3 text, loc4 text, loc5 text, loc6 text, loc7 text, loc8 text, loc9 text, loc10 text, loc11 text, loc12 text, loc13 text, loc14 text);


ALTER TABLE public.ventas_por_producto OWNER TO postgres;

